  return (props.trigger) ? (
    <div className='popup'>
        <div className="popup-inner">
            <h1>Opps!!!</h1>
            <h2>Our website is currently under construction. We should be back shortly. Thank you for your patience.</h2>
            <img src={ComingSoon} alt=""  style={ { }}/>
